  \"2016-07-27T22:21:36.341448\",\n\t\"name\": \"abnormal-anuran-surveys-conducted-at-lower-klamath-clear-lake-and-modoc-national-wildlife-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Abstract Abnormal anuran surveys were conducted
  on three National Wildlife Refuges (NWR) in northern California in 2005. The three
  refuges selected were Lower Klamath NWR, Clear Lake NWR, and Modoc NWR. Only Modoc
  NWR had been surveyed the previous year. Two hundred and eighty three metamorphic
  bullfrogs (Rana catesbeiana) were captured at Lower Klamath NWR with fourteen abnormalities
  encountered for a prevalence of 5%. Clear Lake NWR had seventy five metamorphic
  bullfrogs captured with fifteen abnormalities encountered for a prevalence of 20%.
  There were no metamorphic bullfrogs encountered at Modoc NWR in 2005, however, the
  previous year had detection of chytridiomycosis in moribund tadpoles from this refuge
  and may have caused a decline in the cohort production for the following year. Additional
  work was conducted for chytrid in bullfrogs from Lower Klamath NWR and Modoc NWR
  to elucidate the impact of this emerging infectious disease in the introduced bullfrog.\",\n\t\"license_title\":
